// postRecord.js - Passes the POST API request from React to Express server

// Connect with the Express server
const addRecordEndpoint = 'http://localhost:5001/deleteData';

export default function deleteRecord(id) {
    var body = {
      'app': 1,
      'ids': [parseInt(id)]
    };

    kintone.api(kintone.api.url(addRecordEndpoint, true), 'DELETE', body, function(resp) {
      // success
      console.log(resp);
      return resp;
    }, function(error) {
      // error
      console.log(error);
      return error;
    });
  }
